import React from 'react'
import Sidebar from '../../components/Sidebar/Sidebar'

export default function Manage() {

    const sidebar = [
        { item: 'Home', icon: 'fa-home' },
        { item: 'Workshop', icon: 'fa-user-friends' }
    ]

    return (
        <>
            <Sidebar sidebar={sidebar} />
            <div>
                <h1>Workshop</h1>
            </div>
        </>
    )
}
